gw4(){return"Erkanntes Problem"},
gw1(){return"Schwerindustrien wie Metall-, Glas- und Zementproduktion sowie aufkommende CO2-negative Pyrolyseprozesse setzen erhebliche Mengen an W\xe4rme frei. Bestehende Technologien k\xf6nnen diese thermische Energie "},
